import React from 'react';

import './App.css';
import Nav from './navbar'
import { BrowserRouter,Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Nav/>
      <Route path='#' element={<h1>Product listing</h1>}/>

      </BrowserRouter>
    </div>
  );
}

export default App;
